window.bookSummaryJSON = "<p>Wicca has changed Morgan’s life. She’s lost old friends, made new ones, and discovered her heritage. She also found love and betrayal.</p> <p>But there’s so much more to learn. She knows Wicca can be used for good or for evil. The hard part is knowing which is which.</p> <p>For now, Morgan is safe from the dark wave that has been attacking witches. Betrayed by her first love, she is trying to come to grips with her Woodbane heritage and with Wicca—its thorn and its rose.</p> <p>Love, betrayal, excitement, distrust…Morgan has experienced them all, and it’s not over yet.</p>"; 
